import React from 'react';
import rainingMoney from '../media/rainingMoney.jpg';
import './style.css';

const Destinations = () => {
  return (
    <gg>
      <div className="container text-box">
        <div className="row">
          <div className="col-sm-12s">
          <img className="img-responsive  thumb small" style={{width: 200, height: 100}}
            margin={'auto'} src={rainingMoney} alt="" />
          </div>
        </div>
        <div className="row">
        <div className="col-sm-12">
          <p className="vibe">this is a test</p>
          </div>
        </div>
      </div>
    
    </gg >
  );
}

export default Destinations;
